		/**
		 * @description 获取数据
		 * @return {String} json格式 {name:'xxxx',data:[]}
		 * @see Person#say
		 */
		getData:function(){
			this.query(nls.demo_name).then(lang.hitch(this,function(data){
				console.log(data);
				alert("数据总数为:"+data.length);
			}));
		},
		/**
		 * 后台提交请求
		 *
		 * @param {String} name 查询的参数
		 * @returns {Object} 返回的结果对象
		 */
		query:function(name){
			//获取边界
			return dojo.xhrPost({
				url: "http://www.narutogis.com/water/getRainData",
				handleAs: "text",
				content: { name:name }
			}).then(lang.hitch(this, function (response) {
				var json = dojo.fromJson(response);
				if (json.data) {//成功返回
					return json.data;
				} else {
					return [];
				}
			}));
		},
